INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (44, "獣人族", "トゥインクルウィッシュ", 0, 155, 27, 16, 2, "ヒヨリ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "A", 100101, 8, "東山奈央", "人助け、応援", "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (47, "ヒューマン", "トゥインクルウィッシュ", 0, 158, 5, 17, 2, "ユイ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "O", 100201, 4, "種田梨沙", "料理、人間観察", "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (46, "魔族", "トゥインクルウィッシュ", 0, 163, 12, 18, 2, "レイ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "B", 100301, 1, "早見沙織", "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (27, "ヒューマン", "リトルリリカル", 0, 128, 10, 9, 5, "ミソギ", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "O", 100401, 8, "諸星すみれ", "いたずら、探検", "探検好きのイタズラっ子");
