INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (42, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 150, 22, 13, 7, "アカリ", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "O", 100601, 11, "浅倉杏美", "サックス", "甘え上手なみんなの人気者");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (32, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 130, 23, 14, 7, "ミヤコ", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "B", 100701, 1, "雨宮天", "プリンを食べること", "プリン大好きゴースト娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (40, "エルフ", "ヴァイスフリューゲル　ランドソル支部", 0, 150, 10, 14, 15, "ユキ", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "AB", 100801, 10, "大空直美", "鏡で自分を見ること", "ボクは誰よりも美しい");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (45, "魔族", "トワイライトキャラバン", 0, 159, 5, 17, 13, "アンナ", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "A", 100901, 7, "髙野麻美", "小説執筆", "前世を信じる中二病患者、「疾風の冥姫」");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (42, "獣人族", "自警団（カォン）", 0, 155, 22, 16, 10, "マホ", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "O", 101001, 9, "内田真礼", "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (44, "ヒューマン", "ラビリンス", 0, 156, 25, 15, 3, "リノ", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "A", 101101, 8, "阿澄佳奈", "お裁縫", "人懐っこくてマシンガントークな妹系少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (46, "エルフ", "フォレスティエ", 0, 156, 24, 17, 6, "ハツネ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "A", 101201, 12, "大橋彩香", "妹と遊ぶこと、二度寝、昼寝、早寝", "みんなのために超能力を使う眠り姫");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (55, "魔族", "トワイライトキャラバン", 0, 166, 21, 18, 13, "ナナカ", "", "O", 101301, 8, "佳村はるか", "読書、魔法", "オタク全開な魔法少女");
