INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (54, "エルフ", "フォレスティエ", 0, 165, 5, 21, 6, "ミサト", "test", "O", 101501, 9, "國府田マリ子", "絵本作り", "母性溢れる優しいみんなの「ミサト先生」");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (48, "魔族", "ルーセント学院", 0, 167, 10, 17, 14, "スズナ", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "O", 101601, 4, "上坂すみれ", "ファッション", "天真爛漫で人気者のカリスマモデル");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (53, "獣人族", "自警団（カォン）", 0, 158, 7, 17, 10, "カオリ", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "A", 101701, 7, "高森奈津美", "踊り、空手", "いつでも「なんくるないさ～」な天然娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (52, "魔族", "ルーセント学院", 0, 162, 14, 23, 14, "イオ", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "B", 101801, 8, "伊藤静", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "多くの男性を魅了する無垢な女教師");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (21, "獣人族", "リトルリリカル", 0, 117, 3, 10, 5, "ミミ", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "O", 102001, 4, "日高里菜", "かわいいもの集め", "お歌もにんじんも、ウサギさんも大好き♪");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (40, "ヒューマン", "サレンディア救護院", 0, 150, 9, 12, 9, "クルミ", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "B", 102101, 6, "植田佳奈", "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (40, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 150, 22, 13, 7, "ヨリ", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "O", 102201, 11, "原紗友里", "ゲーム全般", "人見知りであまのじゃくな女の子");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (38, "ヒューマン", "サレンディア救護院", 0, 148, 10, 14, 9, "アヤネ", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "B", 102301, 5, "芹澤優", "屋内でできる遊び", "ぷうきちといつも一緒！");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (43, "ヒューマン", "サレンディア救護院", 0, 154, 12, 15, 9, "スズメ", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "O", 102501, 12, "悠木碧", "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (42, "獣人族", "牧場（エリザベスパーク）", 0, 144, 1, 17, 11, "リン", "test", "B", 102601, 1, "小岩井ことり", "あんパン", "遊びと睡眠が何より大事なぐうたら娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (43, "魔族", "トワイライトキャラバン", 0, 154, 30, 16, 13, "エリコ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "B", 102701, 7, "橋本ちなみ", "実験、裁縫、料理", "運命の相手に一途すぎる乙女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (43, "エルフ", "サレンディア救護院", 0, 156, 4, 17, 9, "サレン", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "A", 102801, 10, "堀江由衣", "経営、お茶会", "救護院を経営する優しい庶民派お嬢様");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (40, "ヒューマン", "カルミナ", 0, 157, 24, 17, 4, "ノゾミ", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "B", 102901, 1, "日笠陽子", "舞台鑑賞、ダンス", "歌って踊れる大人気アイドル");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (51, "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 0, 163, 31, 16, 15, "ニノン", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "O", 103001, 8, "佐藤聡美", "忍法開発", "トーゴクの神秘、オシエテクダサイ！");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (42, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 157, 22, 18, 7, "シノブ", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "AB", 103101, 12, "大坪由佳", "占い", "占いが得意な霊能少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (45, "ヒューマン", "メルクリウス財団", 0, 157, 12, 18, 12, "アキノ", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "AB", 103201, 3, "松嵜麗", "慈善事業", "一人前の商人を目指すパワフルお嬢様");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (35, "ヒューマン", "牧場（エリザベスパーク）", 0, 142, 3, 20, 11, "マヒル", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "B", 103301, 3, "新田恵海", "漫才", "みんなを笑顔にするお笑い牧場主");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (55, "エルフ", "メルクリウス財団", 0, 164, 16, 22, 12, "ユカリ", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "A", 103401, 3, "今井麻美", "ウインドーショッピング", "純情でほっとけない大人の女性");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (21, "エルフ", "リトルリリカル", 0, 118, 2, 8, 5, "キョウカ", "test", "A", 103601, 2, "小倉唯", "お勉強", "礼儀正しくしっかり者のちびっ子優等生");
