INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (40, "獣人族", "牧場（エリザベスパーク）", 0, 153, 3, 14, 11, "シオリ", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "A", 103801, 11, "小清水亜美", "読書、お散歩", "読書が趣味の病弱少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (44, "エルフ", "フォレスティエ", 0, 158, 6, 13, 6, "アオイ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "AB", 104001, 6, "花澤香菜", "友達作りのイメトレ", "「友達」に憧れる、エルフの森の女の子");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (46, "ヒューマン", "カルミナ", 0, 163, 3, 17, 4, "チカ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "O", 104201, 6, "福原綾香", "各種楽器", "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (54, "獣人族", "自警団（カォン）", 0, 168, 9, 17, 10, "マコト", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "O", 104301, 8, "小松未可子", "お菓子作り", "男勝りで情に厚いワイルド娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (50, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 172, 5, "??", 7, "イリヤ", "test", "A", 104401, 5, "丹下桜", "世界征服", "かつては夜を支配した最強の吸血鬼");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (49, "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 0, 157, 19, 18, 15, "クウカ", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "AB", 104501, 11, "長妻樹里", "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (48, "獣人族", "メルクリウス財団", 0, 158, 1, 19, 12, "タマキ", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "AB", 104601, 3, "沼倉愛美", "猫とたわむれること", "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (50, "ヒューマン", "王宮騎士団（NIGHTMARE）", 0, 171, 25, 25, 8, "ジュン", "？？？", "A", 104701, 10, "川澄綾子", "格闘技、湯浴み", "素顔を見せない冷静沈着な女性騎士");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (49, "ヒューマン", "メルクリウス財団", 0, 163, 11, 20, 12, "ミフユ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "O", 104801, 11, "田所あずさ", "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (54, "ヒューマン", "ラビリンス", 0, 168, 24, 18, 3, "シズル", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "O", 104901, 10, "生天目仁美", "家事全般", "お姉ちゃんがお世話してあげるからねっ！");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (22, "魔族", "ルーセント学院", 0, 120, 3, 11, 14, "ミサキ", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "A", 105001, 1, "久野美咲", "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (53, "ヒューマン", "トワイライトキャラバン", 0, 166, 7, 27, 13, "ミツキ", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "A", 105101, 3, "三石琴乃", "研究、実験", "実験が趣味の危険な科学者");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (100, "獣人族", "牧場（エリザベスパーク）", 0, 150, 14, 17, 11, "リマ", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "A", 105201, 3, "徳井青空", "毛繕い、お喋り", "乙女チックなもふもふアニマル");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (33, "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 0, 140, 28, 17, 15, "モニカ", "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "A", 105301, 7, "辻あゆみ", "お菓子屋通い", "見た目も中身もお子ちゃまな異国の軍人");
