INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (48, "獣人族", "メルクリウス財団", 0, 158, 1, 19, 12, "タマキ（サマー）", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "AB", 107901, 3, "沼倉愛美", "猫とたわむれること", "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (49, "ヒューマン", "メルクリウス財団", 0, 163, 11, 20, 12, "ミフユ（サマー）", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "O", 108001, 11, "田所あずさ", "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (42, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 157, 22, 18, 7, "シノブ（ハロウィン）", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "AB", 108101, 12, "大坪由佳", "占い", "占いが得意な霊能少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (32, "魔族", "悪魔偽王国軍（ディアボロス）", 0, 130, 23, 14, 7, "ミヤコ（ハロウィン）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "B", 108201, 1, "雨宮天", "プリンを食べること", "プリン大好きゴースト娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (22, "魔族", "ルーセント学院", 0, 120, 3, 11, 14, "ミサキ（ハロウィン）", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "A", 108301, 1, "久野美咲", "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (46, "ヒューマン", "カルミナ", 0, 163, 3, 17, 4, "チカ（クリスマス）", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "O", 108401, 6, "福原綾香", "各種楽器", "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (40, "ヒューマン", "サレンディア救護院", 0, 150, 9, 12, 9, "クルミ（クリスマス）", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "B", 108501, 6, "植田佳奈", "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (38, "ヒューマン", "サレンディア救護院", 0, 148, 10, 14, 9, "アヤネ（クリスマス）", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "B", 108601, 5, "芹澤優", "屋内でできる遊び", "ぷうきちといつも一緒！");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (44, "獣人族", "トゥインクルウィッシュ", 0, 155, 27, 16, 2, "ヒヨリ（ニューイヤー）", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "A", 108701, 8, "東山奈央", "人助け、応援", "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (47, "ヒューマン", "トゥインクルウィッシュ", 0, 158, 5, 17, 2, "ユイ（ニューイヤー）", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "O", 108801, 4, "種田梨沙", "料理、人間観察", "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (46, "魔族", "トゥインクルウィッシュ", 0, 163, 12, 18, 2, "レイ（ニューイヤー）", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "B", 108901, 1, "早見沙織", "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (43, "魔族", "トワイライトキャラバン", 0, 154, 30, 16, 13, "エリコ（バレンタイン）", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "B", 109001, 7, "橋本ちなみ", "実験、裁縫、料理", "運命の相手に一途すぎる乙女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (54, "ヒューマン", "ラビリンス", 0, 168, 24, 18, 3, "シズル（バレンタイン）", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "O", 109101, 10, "生天目仁美", "家事全般", "お姉ちゃんがお世話してあげるからねっ！");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (55, "ヒューマン", "？？？", 0, 156, 1, 17, "", "アン", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "AB", 109201, 12, "日笠陽子", "読書", "英霊と契約を結んだマナリアの天才王女");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (45, "ヒューマン", "？？？", 0, 144, 4, 16, "", "ルゥ", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "O", 109301, 2, "こやまきみこ", "食べること、眠ること", "マナリア魔法学院の新入生");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (67, "半人半竜", "？？？", 0, 167, 3, 17, "", "グレア", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "B", 109401, 11, "福原綾香", "ピアノ", "人を超越した力を有す心優しい竜姫");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (49, "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 0, 157, 19, 18, 15, "クウカ（オーエド）", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "AB", 109501, 11, "長妻樹里", "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES (51, "ヒューマン", "ヴァイスフリューゲル　ランドソル支部", 0, 163, 31, 16, 15, "ニノン（オーエド）", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "O", 109601, 8, "佐藤聡美", "忍法開発", "トーゴクの神秘、オシエテクダサイ！");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("??", "鬼族", "？？？", 0, 154, 2, 17, "", "レム", "", "?", 109701, 2, "水瀬いのり", "演劇鑑賞、詩文", "鬼がかりの万能妹メイド");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("??", "鬼族", "？？？", 0, 154, 2, 17, "", "ラム", "", "?", 109801, 2, "村川梨衣", "読書", "毒舌系鬼姉メイド");
